import React from "react";
import styled from "styled-components";
import { Contentdiv, TitleDiv, Row, Col, TextBox } from "./styles/commonstyle";

const Contact = () => {
  return (
    <React.Fragment>
      <Contentdiv>
        <TitleDiv>Contact</TitleDiv>

        <Row>
          <Col>
            <TextBox>
                  <img src="https://cdn.pixabay.com/photo/2017/08/23/11/30/twitter-2672572_960_720.jpg" alt="https://cdn.pixabay.com/photo/2017/08/23/11/30/twitter-2672572_960_720.jpg" style="width: 25px; height: 25px;"></img>
                  <a href="@Timothe_Renaud"> @Timothe_Renaud </a>
                  <a href="https://www.pearltrees.com/"> https://www.pearltrees.com/ </a>
            </TextBox>
          </Col>
        </Row>

      </Contentdiv>
    </React.Fragment>
  );
};

export default Contact;
